CREATE FUNCTION `age`(`dob` DATE) RETURNS varchar(32) CHARSET latin1
    NO SQL
BEGIN
DECLARE age varchar(32); 
DECLARE days int(9); DECLARE yrs int(9);
DECLARE hrs int(9); 
DECLARE months int(9);
set days = datediff(CURRENT_DATE, dob);
set yrs = floor(days/365);
set months = floor(days/30);
set hrs = floor(days*24);
IF yrs > 0 THEN
RETURN concat(yrs, " yrs");
ELSEIF (yrs < 1 and months > 0) THEN
RETURN concat(months, " months");
ELSEIF (months < 1 and days > 0) THEN
RETURN concat(days, " days");
ELSEIF (days < 1 and hrs > 0) THEN
RETURN concat(hrs, " hrs");
ELSE
RETURN "NA";
END IF;
RETURN age;
END ;;
